package javaExampleProject.Basic;

public class NestedIfDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i=10;
		if(i<11) {
			if(i>9) {
				System.out.println("value of i=10");
			}
			else {
				System.out.println("value of i less than 10");
			}
		}
	}

}
